import React from "react";
import axios from "axios";

export const getTaxonomyfromAPI = async () => {
  let res = { data: [], status: 200 };
  let respose = axios.get(
    "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
  );
  res.data = respose.data;
  res.status = respose.status;
  return res;
};
